/*Table structure for table `desiderata` */

DROP TABLE IF EXISTS `desiderata`;

CREATE TABLE `desiderata` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `heureDebut` time DEFAULT NULL,
  `heureFin` time DEFAULT NULL,
  `dateDePassage` datetime DEFAULT NULL,
  `dateEnvoi` datetime DEFAULT NULL,
  `heureEnvoi` time DEFAULT NULL,
  `codeUE` varchar(10) DEFAULT NULL,
  `matriculeEnseignant` varchar(10) DEFAULT NULL,
  `ancienneheuredebut` time DEFAULT NULL,
  `ancienneDatedePassage` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;

